import React, { Component } from 'react';

class Appheader extends Component{
    render(){
        return( 
           
            <header className="App-header">           
            
            
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>

        );
    }
}

export default Appheader;
